import styled from 'styled-components';

const MenuTreeStyles = styled.ul`
  background: lightgray;
  margin: 0;
`;

const TreeNodeStyles = styled.li`
  display: inline;
  font-size: 1.7rem;
  font-weight: 300;
  text-transform: capitalize;
  a {
    text-decoration: none;
  }
  &:last-of-type {
    a {
      color: white;
    }
  }
  &:before {
    content: ' > ';
  }
  &:first-of-type {
    &:before {
      content: none;
    }
  }

`;

export { MenuTreeStyles, TreeNodeStyles };
